import logo from './logo.svg';
import youngjo from './assets/images/young.PNG'
import './App.css';
import BubbleChat from './components/speech_bubble';

function App() {
  const messages = [
    '안녕하세요!',
    '어떤 내용을 표시할까요?',
    'React로 말풍선 채팅창을 만들어보세요.',
    '다음을 클릭하면 다음 말이 이어집니다.',
    '좋은 하루 되세요!',
  ];
  return (
    <div className="flex bg-black h-screen">
      <header className="">
        <img src={youngjo} className="" alt="logo" />
        <BubbleChat messages="{messages}" img="{youngjo}"/>
      </header>
    </div>
  );
}

export default App;
